import React from 'react';
import './App.css';
import LobbyMode from './components/LobbyMode';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h4>Welcome to Greed</h4>
		<LobbyMode />

      </header>
    </div>
  );
}

export default App;
